pragma solidity ^ 0.8.0;

contract Users {

    	uint public patientCount;
		uint public doctorCount;
		uint public pharmacyCount;
		uint public healthCarecount;
		Patient [] public patientrecords;
		struct Patient {
				address patientAddress;
				string name;
				uint age;
				uint contact;
				string userAddress;
				uint prescriptionCount;
				uint receiptCount;
				uint recordCount;
				Prescription[] prescriptions;
				Record[] records;
				Receipt[] receipts;

		}
		struct Doctor {
			address doctorAddress;
			address healthCareAddress;
			uint id;
			string name;
			string designation;
			Patient [] patients;
		}


		struct HealthCare {
				address chainAddress;
				string name;
				uint contact;
				address healthCareAddress;
				uint patientsCount;
		}

		struct Record {
				uint recordid;
				string disease;
				address doctorAddress;
				address chainAddress;
				uint256 timestamp;
		}

		struct Receipt {
				uint receiptid;
				address chainAddress;
				uint256 timestamp;
				uint totalcost;
				string drugname;
				uint drugCount;
				uint256 receiptNumber;
		}

		struct Prescription {
				uint prescriptionid;
				address doctorAddress;
				address chainAddress;
				uint256 timestamp;
				string drugname;
				uint drugCost;
				uint drugCount;
		}


		event AddPatient(
